import { GET_THINGS } from "./types";
import ThingiverseApi from "../ThingiverseApi"

function get_things() {
    return async function (dispatch){
        const res = await ThingiverseApi.getAll('things');
        return { type: GET_THINGS, payload: res }
    }

  }

export {get_things}
